        and: [
            { or: ["2k"], abc: "def" },
            { mc: 8, ghi: "jkl" },
        ],
        mno: "pqr",
    }, {
        instancePath: "/and/0",
        message: "or satisfy rule should have property 'or' only",
    }, {
        instancePath: "/and/1",
        message: "MC satisfy rule should have property 'mc' only",
