isInvalidRule({
    or: [
        { mc: 5, and: ["CS2040"] },
        { and: [{ and: ["abc"], or: ["def"] }] },
    ],
}, { instancePath: "/or/0", message }, { instancePath: "/or/1/and/0", message });
